import { Button, Checkbox, FormControl, FormControlLabel, Input, InputAdornment, Paper, TextField, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";
import style from './CadastroCliente.module.scss';
import moment from "moment";
import axios from "axios";

export const CadastroCliente = ({ setCadastroCliente }) => {

    const [cadastro, setCadastro] = useState({
        nome: '',
        rgOuCnpj: '',
        endereco: '',
        utilizaEndereco: false,
        celular: '',
        email: '',
        restricaoFinanceira: false,
        agenteFinanceiro: '',
        alteraEndereco: false,
        novoEndereco: '',
        novoenderecoCEP: '',
        alteraInfoProprietario: '',
        alteraInfoVeiculo: '',
        alteraInfoFinanceira: '',
        alteraInfoEnderecoEntrega: '',
        novoEnderecoLogra: '',
        novoEnderecoNum: '',
        novoEnderecoBairro: '',
        novoEnderecoCidade: '',
        novoEnderecoUF: '',
        novoEnderecoCEP: '',
        correcaoRestricoes: '',
        emissaoDCPPO: '',
        fornecimentoPlacaExperienciaFabricante: '',
        inclusaoRestricaoFinanceria: '',
        liberacaoAverbacaoExecucao: '',
        liberacaoRestricaoFinanceira: '',
        licencaEspecialTransito: '',
        mudancaPlacaUnica: '',
        primeiroEmplacamento: '',
        renovacaoPlacaExperienciaFabricante: '',
        reservaPlaca: '',
        restricaoTransferencia: '',
        solicitacaoAlteracaoCaracteristicas: '',
        solicitacaoRegravacaoChassi: '',
        solicitacaoTransporteEscolar: '',
        alteracaoExecucao: '',
        baixaPlacaExperienciaFabricante: '',
        baixaOutraUF: '',
        baixaVeiculo: '',
        baixaVeiculoCampo: '',
        cancelamentoProcesso: '',
        colocacaoLacrePlaca: '',
        comunicacaoVenda: '',
        correcaoObservacoes: '',
        correcaoChassi: '',
        correcaoInformacoesProprietario: '',
        correcaoInformacoesVeiculo: '',
        correcaoMunicipio: '',
        autorizoEmailTelefone: '',
        naoAutorizoInformacoes: '',
        solicitaCertidao: '',
        solicitaCopiaDocumento: '',
        solicitaCopiaCRLV: '',
        solicitaVistoria: '',
        solicitaDCPPO: '',
        transferePropriedadeVeiculoOutro: '',
        transferePropriedadeVeiculoRS: '',
        trocaMunicipioOutroEstado: '',
        trocaMunicipioRS: '',
        Outros: '',
        campoOutros: '',
        relativoVeiculo: '',
        relativoChassiOuPlaca: '',
        data: '',
    })

    const [segundaVia, setSegundaVia] = useState({
        CRLV: false,
        CRV_CRLV: false,
        segundaViaMotivo: ''
    })

    const [d, setD] = useState(moment().format("YYYY-MM-DD"))

    const [email1, setEmail1] = useState(false)

    const CadastraCelular = (e) => {
        const numero = e.target.value.replace(/[^0-9]/g, '');
        console.log(numero)
        setCadastro(a => ({ ...a, celular: numero }))
    }

    const CadastroEmail = (e) => {
        let arroba = cadastro.email.includes("@")
        let ponto = cadastro.email.includes('.')
        if ((arroba === false) || (ponto === false)) {
            setEmail1(true)
        } else {
            setEmail1(false)
        }
    }

    const registroFinanceiro = (e) => {
        setCadastro(a => ({ ...a, restricaoFinanceira: false, agenteFinanceiro: '' }))
    }

    const SegundaVia = (e) => {
        const valida = e.target.id;
        console.log(e.target.id)
